<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <title>Document</title>
  <meta http-equiv="X-UA-Compatible" content="IE=edge,chrome=1" />
  <meta name="description" content="Description">
  <meta name="viewport" content="width=device-width, user-scalable=no, initial-scale=1.0, maximum-scale=1.0, minimum-scale=1.0">
  <link rel="stylesheet" href="//unpkg.com/docsify/lib/themes/dark.css">
</head>
<body>
  <div id="app"></div>
  <script type="text/javascript">
    window.$docsify = {
      name: 'ZyCAP PR',
      repo: 'https://github.com/warclab/zycap2',
      loadSidebar: true,
      themeColor: '#AA49BB',
      basePath: '/',
      routerMode: 'history',
    search: {
      maxAge: 86400000, // Expiration time, the default one day
      // Localization
      placeholder: {
        '/': 'Type to search'
      },
      // Localization
      noData: {
        '/': 'No Results'
      },
      hideOtherSidebarContent: true, // whether or not to hide other sidebar content
    }
    }
  </script>
  <script src="//unpkg.com/docsify/lib/docsify.min.js"></script>
  <script src="//unpkg.com/docsify/lib/plugins/search.min.js"></script>
  <script src="//unpkg.com/prismjs/components/prism-verilog.min.js"></script>
  <script src="//unpkg.com/prismjs/components/prism-tcl.min.js"></script>
  <script src="//unpkg.com/prismjs/components/prism-cpp.min.js"></script>
</body>
</html>
